import React from 'react';
import {
    Typography,
    Container,
    Paper,
    Button,
    Box,
  } from '@mui/material';
  
  const Home = () => {
    return (
      <>  
        <Container maxWidth="md" sx={{ my: 4 }}>
          <Paper elevation={3} sx={{ p: 4 }}>
            <Typography variant="h4" gutterBottom>
              Welcome to Hen & Eggs
            </Typography>
            <Typography variant="body1" gutterBottom>
              Discover fresh farm eggs straight from happy hens. We value quality, warmth, and organic goodness.
            </Typography>
            <Box mt={3}>
              <Button variant="contained" color="secondary">
                Learn More
              </Button>
            </Box>
          </Paper>
        </Container>
      </>
    );
  };
  
export default Home;
